Lesdoelen 
Leerdoelen 
De verpleegkundige:
verzamelt gegevens adequaat uit informatie en signalen van zorgvragers, het sociale netwerk en andere zorgverleners; 
reageert adequaat op de (non-)verbale signalen van de zorgvrager; 
toont actief aandacht voor de beleving van veiligheid en welbevinden door de zorgvrager en het sociale netwerk;
 kiest de juiste materialen en middelen afgestemd op de doelgroep;
 legt onderwerpen duidelijk en begrijpelijk uit op het kennis- en taalniveau van de zorgvrager en het sociale netwerk; 
voert motiverende gesprekken afgestemd op de zorgverlener en het sociale netwerk; 
rapporteert bevindingen nauwkeurig en volledig en past indien nodig in overleg de zorgverlening aan.
